import React from 'react'
import {Route, Redirect} from 'react-router-dom'
import { DefaultLayout } from '../../../layout/default-layout/DefaultLayout'
const isAuth = true
export const PrivateRoute = ({children}) => {
  return (
    <Route render={()=>{
        (isAuth?{children}:<Redirect to="/"></Redirect>)
    }}/>
    
  )
}
